import classes from "./MyPosts.module.css";
import Post from "./Post/Post";

const MyPosts = () => {

  let postsData = [
    { id: 1, message: "Hello, whats up?", likes:20 },
    { id: 2, message: "It's my birthday today", likes: 30 },
  ]

  let postElements = postsData.map((post) => {
    return <Post message={post.message} likes={post.likes} />
  })

  return (
    <div className={classes.myPosts}>
      <div className={classes.newPost}>
        <div>
          <textarea name="" id="" cols="30" rows="3"></textarea>
        </div>
        <div>
          <button>Add post</button>
        </div>
      </div>
      <div className={classes.posts}>
        My Posts
        <Post message={postsData[0].message} likes={postsData[0].likes} />
        <Post message={postsData[1].message} likes={postsData[1].likes} />
      </div>
    </div>
  );
};
export default MyPosts;
